import {Grid, Col, Row} from 'react-styled-flexboxgrid';
import { createGlobalStyle } from 'styled-components';

const GlobalStyle = createGlobalStyle`
  body {
    background-color: #f4f9ff;
  }
`;

const Index = () => (
  <Grid>
    <GlobalStyle />
    <Row>
      <Col xs={6} md={3}>
        <p>Hello Next.js</p>
      </Col>
    </Row>
  </Grid>
)

export default Index
